import axios from "axios";

class ProgressDataService {
    retrieveAllProgresses(username) {
        return axios.get(`http://localhost:8080/users/${username}/progresses`);
    }

    retrieveProgress(username, day) {
        return axios.get(`http://localhost:8080/users/${username}/progresses/${day}`);
    }

    updateProgress(username, day, progress) {
        return axios.put(`http://localhost:8080/users/${username}/progresses/${day}`, progress);
    }

    updateProgress(username, day, progress) {
        return axios.put(`http://localhost:8080/users/${username}/progresses/${day}`, progress);
    }

    deleteProgress(username, day) {
        return axios.delete(`http://localhost:8080/users/${username}/progresses/${day}`);
    }
}

export default new ProgressDataService();
